class Solution:    def wallsAndGates(self, rooms):        """        Do not return anything, modify rooms in-place instead.        """        if len(rooms) == 0 or len(rooms[0]) == 0:return        m, n = len(rooms), len(rooms[0])        visited = [[0 for i in range(n)] for j in range(m)]        level, next_level = [], []        for i in range(m):            for j in range(n):                if rooms[i][j] == 0:                    level.append([i, j])                    visited[i][j] = 1        directions = [[-1, 0], [1, 0], [0, -1], [0, 1]]        count = 1        while level or next_level:            while level:                i, j = level.pop()                for ii, jj in directions:                    if 0<=i+ii<m and 0<=j+jj<n:                        if visited[i+ii][j+jj] == 0 and rooms[i+ii][j+jj] == 2147483647:                            next_level.append([i+ii, j+jj])                            visited[i + ii][j + jj] = 1                            rooms[i+ii][j+jj] = count            count += 1            level = copy.deepcopy(next_level)            next_level = []        return